import React, { useState } from 'react';

function App() {
  const [topic, setTopic] = useState(null);
  const fetchTopic = async () => {
    const response = await fetch('http://localhost:8000/api/topics/random');
    const data = await response.json();
    setTopic(data);
  };
  // Your code here

  return (
    <div>
      {<button onClick={fetchTopic}>Get Random Topic</button>}
      {topic && <h1>{topic.text}</h1>}
    </div>
  );
}

export default App;
